import React from 'react';
import styled from 'styled-components';

const StyleProductHeading = styled.div`
        display: flex;
        align-items: center;
        justify-content: space-between;
`

const ProductHeading = ({children}) => {
    return (
        <StyleProductHeading>
            {children}
        </StyleProductHeading>
    );
};

export default ProductHeading;
